import React, { useState, useEffect } from 'react';

const FeedbackDetailsPage = ({ id }) => {
  const [feedback, setFeedback] = useState(null);
  const [ratings, setRatings] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      setLoading(true);
      try {
        const [feedbackResponse, ratingsResponse] = await Promise.all([
          fetch('http://localhost:3000/feedback'),
          fetch('http://localhost:3000/ratings')
        ]);

        console.log('Feedback Response:', feedbackResponse);
        console.log('Ratings Response:', ratingsResponse);

        if (!feedbackResponse.ok) {
          const feedbackError = await feedbackResponse.text();
          throw new Error(`Failed to fetch feedback: ${feedbackError}`);
        }
        if (!ratingsResponse.ok) {
          const ratingsError = await ratingsResponse.text();
          throw new Error(`Failed to fetch ratings: ${ratingsError}`);
        }

        const feedbackData = await feedbackResponse.json();
        const ratingsData = await ratingsResponse.json();

        console.log('Feedback Data:', feedbackData);
        console.log('Ratings Data:', ratingsData);

        setFeedback(feedbackData);
        setRatings(ratingsData);
      } catch (error) {
        console.error('Error fetching data:', error);
        setError(error.message);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, [id]);

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error}</div>;
  if (!feedback || !ratings) return <div>No feedback or ratings found</div>;

  // Rest of the component remains the same...
};

export default FeedbackDetailsPage;
